import React, {useRef} from 'react';
import './imageButton.css';

function ImageButton({imageSrc, imageHover, alt, css, type}) : any {
  let url:string = 'this.src='+imageHover;

  

  return (
      <button className="ImageBtn" style={css} >
        <img src={imageSrc} alt={alt} onmouseover={url}/>
      </button>
  );
}

export default ImageButton;
